import React, { Component } from 'react';

class Search extends Component {
    
    hideClicked = (event) =>{
        var a = this.props.showFormFromApp;
        event.target.hide()
        return true
    }

    render() {
        return (
            <div>
                <div className="col-12">
                    <div className="form-group">
                        <div className="btn btn-group">
                            <input type="text" className="form-control" aria-describedby="helpId" style={{width: '480px'}} />
                            <div className="btn btn-info">Search</div>
                        </div>
                    </div>
                </div>
                <div onClick = { (event) => this.hideClicked(event) } className="btn btn-block btn-outline-primary">Add new</div>
                <div onClick = { this.props.showFormFromApp }  className="btn btn-block btn-outline-info">Close </div>
                <div className="col-12">
                    <hr />
                </div>

          </div>
        );
    }
}

export default Search;
